import React, { useState } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import './StudentProfile.css';
import image from './Assets/logo.png';
import axios from 'axios'; // Import axios for making HTTP requests

function ProfilePage() {
  const location = useLocation();
  const navigate = useNavigate();
  const { student } = location.state || {};

  const [isEditing, setIsEditing] = useState(false);
  const [formData, setFormData] = useState(student);

  const handleInputChange = (e) => {
    const { name, value } = e.target;
    setFormData({ ...formData, [name]: value });
  };

  const handleEditClick = () => {
    setIsEditing(true);
  };

  const handleSaveClick = async () => {
    try {
      // Replace `yourApiEndpoint` with your actual API endpoint
      await axios.put(`/api/students/${formData.studentid}`, formData);
      setIsEditing(false);
      alert('Profile updated successfully!');
    } catch (error) {
      console.error('Error updating profile:', error);
      alert('Failed to update profile.');
    }
  };

  const handleCancelClick = () => {
    setFormData(student); // Reset formData to original student data
    setIsEditing(false);
  };

  const handleReturn = () => {
    navigate('/app');
  };

  if (!student) {
    return <div>No student data available.</div>;
  }

  return (
    <>   
      <div className="header">
        <img src={image} alt="logo" />
      </div>
      <div className="title">
        <h2>Higher Studies Students Data</h2>
      </div>
      <div className="profile-container">
        <div className="profile-header">
          <h1>{formData.studentname}</h1>
        </div>
        <div className="profile-details">
          {Object.keys(student).map((key) => (
            <div className='detail-row' key={key}>
              <div className="detail-label">{key.replace(/([A-Z])/g, ' $1').toUpperCase()}</div>
              <div className="detail-data">
                {isEditing ? (
                  <input
                    type={key === 'emailid' ? 'email' : 'text'}
                    name={key}
                    value={formData[key] || ''}
                    onChange={handleInputChange}
                  />
                ) : (
                  <span>{formData[key]}</span>
                )}
              </div>
            </div>
          ))}
          <div className="scores">
            <h3 className='score-heading'>Scores</h3>
            {Object.entries(formData.scores || {}).map(([subject, score]) => (
              <div className='detail-row' key={subject}>
                <div className="detail-label">{subject}</div>
                <div className='detail-data'>{score}</div>
              </div>
            ))}
          </div>
          <div className='button'>
            {isEditing ? (
              <>
                <div>
                  <button className='save-button' onClick={handleSaveClick}>Save</button>
                </div>
                <div>
                  <button className='cancel-button' onClick={handleCancelClick}>Cancel</button>
                </div>
              </>
            ) : (
              <>
                <div>
                  <button className='edit-button' onClick={handleEditClick}>Edit</button>
                </div>
                <div>
                  <button onClick={handleReturn} className="return-button">Return to List</button>
                </div>
                <div>
                  <button className='delete-button'>Delete</button>
                </div>
              </>
            )}
          </div>
        </div>
      </div>
    </>
  );
}

export default ProfilePage;
